1. **避免团队相关问题**：不要询问团队规模、团队协作、成员分工、团队沟通、团队冲突等话题
2. **专注个人视角**：关注创作者个人的想法、感受、经历、挑战和成长
3. **强调独立特质**：突出独立创作的特点，如自主决策、个人风格、独特视角等
